// {no:792, tag:`電話`, word:`<h1 class="ql-align-center"><strong>Cách gọi điện xin baito</strong></h1><p><br></p><h2>Chào hỏi, tự giới thiệu bản thân và nêu nguyện vọng xin baito</h2><p><br></p><blockquote>Nhân viên：はい、〇〇〇店でございます。</blockquote><blockquote>Bạn ：私、ベトナム人留学生のグエンと申します。アルバイトの求人情報を拝見し、お電話させていただきましたが、採用ご担当の方がいらっしゃいますか？。</blockquote><blockquote>Nhân viên：採用担当者ですね。少々お待ちください。</blockquote><p><br></p><p>Nhân viên: Xin chào, đây là cửa hàng 〇〇〇</p><p>Bạn: Tôi là Nguyen, du học sinh Việt Nam. Tôi đã thấy thông tin tuyển dụng của quán nên gọi điện xin ứng tuyển. Người phụ trách tuyển dụng có ở đó không ạ?</p><p>Nhân viên: Vâng, bạn chờ 1 chút nhé.</p><p><br></p><h2>Các tình huống</h2><p><br></p><h3>※Tình huống 1: Trường hợp người phụ trách tuyển dụng không có mặt, bận không thể nghe máy. Chúng ta sẽ hẹn gọi lại sau:</h3><p><br></p><blockquote>Nhân viên：すみません、ただいま採用担当者が外出しております/いないんです。。</blockquote><blockquote>Bạn：では、改めてお電話をおかけ致します。失礼致します。</blockquote><p><br></p><p>Nhân viên: Xin lỗi bạn, người phụ trách tuyển dụng vừa đi ra ngoài mất/ hiện không có mặt ở cửa hàng..</p><p>Bạn: Vâng, vậy thì tôi sẽ gọi lại sau nhé. Tôi xin phép. (cúp máy)</p><p><br></p><h3>※Tình huống 2: Trường hợp không còn tuyển dụng nữa.</h3><p><br></p><blockquote>Nhân viên：　すみません、もう終わっちゃったんですね。</blockquote><blockquote>Bạn：　そうですか。わかりました。では、失礼致します。</blockquote><p><br></p><p>Nhân viên: Xin lỗi nhưng cửa hàng chúng tôi còn tuyển nhân viên nữa..</p><p>Bạn: Tôi hiểu rồi. Vậy tôi xin phép (cúp máy)</p><p><br></p><h3>※Tình huống 3: Người phụ trách nghe máy và trao đổi về thông tin tuyển dụng</h3><p><br></p><blockquote>Người phụ trách：お電話代わりました。採用担当の田中です。</blockquote><blockquote>Bạn：私、グエンと申します。アルバイトの求人情報を見て、お電話いたしましたが、まだ募集していらっしゃいますか。</blockquote><blockquote>Người phụ trách: はい、まだ募集しています</blockquote><blockquote>Bạn：　ホールスタッフに応募したいですが、</blockquote><blockquote>Người phụ trách：そうですか？まず、面接、いつなら来られますか？</blockquote><blockquote>Bạn：〇月〇日の〇〇時は大丈夫です。（Thường ghi sẵn 3 khoảng thời gian để người tuyển dụng lựa chọn）</blockquote><blockquote>Bạn：学校は12時までなので、午後でしたら、いつでも大丈夫です。</blockquote><blockquote>Người phụ trách：では〇月〇日午後〇〇時でどうでしょうか？</blockquote><blockquote>Bạn：はい、わかりました。それでは、〇月〇日午後〇〇時にそちらへ伺います。</blockquote><blockquote>Người phụ trách：来る時、写真付きの履歴書と身分証明書を持ってきてください。</blockquote><blockquote>Bạn：はい、写真付きの履歴書と身分証明書ですね。わかりました。</blockquote><blockquote>Người phụ trách：はい。よろしくお願いします。</blockquote><blockquote>Bạn：はい、どうぞ宜しくお願い致します。</blockquote><blockquote>Người phụ trách：失礼いたします。</blockquote><blockquote>Bạn：失礼いたします。</blockquote><p><br></p><p>Dich:</p><p>Nhân viên: Điện thoại đã được chuyển cho tôi. Tôi là người phụ trách tuyển dụng, Tanaka. 〇〇〇</p><p>Bạn: Tôi là Nguyen. Tôi đã thấy thông tin tuyển dụng của quán nên gọi điện xin ứng tuyển. Hiện tại cửa hàng còn tuyển nhân viên không ạ?</p><p>Người phụ trách: Vâng, cửa hàng mình vẫn đang tuyển.</p><p>Bạn: Tôi muốn ứng tuyển vào vị trí chạy bàn..</p><p>Người phụ trách: Vậy à? Trước tiên là phỏng vấn, khi nào thì bạn có thể đến được?</p><p>Bạn: (nói ngày giờ, khoảng 3 mốc cụ thể) tôi có thể đi được.</p><p>Người phụ trách: Vậy thì …giờ ngày… bạn đến được không?</p><p>Bạn: Vâng, tôi hiểu rồi. Vậy …giờ ngày… tôi sẽ đến.</p><p>Người phụ trách: Khi đến bạn mang theo sơ yếu lí lịch có dán ảnh và giấy tờ chứng minh thân phận nhé.</p><p>Bạn: Sơ yếu lí lịch có dán ảnh và giấy tờ chứng minh thân phận. Vâng tôi hiểu rồi.</p><p>Người phụ trách: Vâng.</p><p>Bạn: Rất mong được giúp đỡ.</p><p>Người phụ trách: Tôi xin phép.</p><p>Bạn: Tôi xin phép. (cúp máy)</p><p><br></p><p><br></p><p><br></p><p><br></p>`, mean:``},
